import { Link } from 'react-router-dom';
import './driver.scss';

function DriverList() {
  const [driver, setDriver] = useState([]);


  const [datatable, setDatatable] = React.useState({
    columns: [
      {
        label: 'Name',
        field: 'name',
        width: 100,
      },
      {
        label: 'Email',
        field: 'email',
        width: 100,
      },
      {
        label: 'Address',
        field: 'address',
        width: 100,
      },
      {
        label: 'Phone No.',
        field: 'phone',
        width: 100,
      },
      {
        label: 'Action',
        field: 'action',
        width: 200,
      },
    ],
    rows: [
      {
        name: 'Sunil Regmi',
        email: 'sunilregmi52@gmail.com',
        address:"Nepaltar, Kathmandu",
        phone: '9813999347',
        action: 'Edit Delete',
      },
      {
        name: 'Anil Regmi',
        email: 'anil@gmail.com',
        address:"Kalanki, Kathmandu",
        phone: '9876543425',
        action: 'Edit Delete',
      },
      {
        name: 'samir Regmi',
        email: 'samir@gmail.com',
        address:"Sundhara, Kathmandu",
        phone: '98273167671',
        action: 'Edit Delete',
      },
    ]
  });

  return (
    <>
      <div className="driver-list">
        <Container fluid>
          <h1>driver list</h1>
          <MDBDataTableV5 hover entriesOptions={[5, 20, 25]} entries={5} pagesAmount={4} data={datatable} />
        </Container>
      </div>
    </>
  )
}

const mapStateToProps = (state) => {
  return {
    loading: state.login.loading,
  };
};
export default connect(mapStateToProps, { fetchDriver })(DriverList);
